  \"2015-11-25T10:53:26.278609\",\n\t\"name\": \"liberia-pids\",\n\t\"isopen\": true,\n\t\"url\":
  null,\n\t\"notes\": \"PIDS is the web-based system designed to allow data input
  and consultative sessions by USAID/Liberia's IPs and USAID personnel.  It is established
  and maintained by the USAID Liberia Monitoring and Evaluation Program (L-MEP) and
  is actively online through this portal with a username and password access. In addition
  to quantitative data relating to indicators, the PIDS permits the uploading, filing,
  and retrieval of qualitative data that can be incorporated into the semi-annual
  Performance Indicator Reference Sheet (PIRS) and the annual Performance Plan and
  Report (PPR).  In this manner, success stories and other informational formats can
  operate within this environment.  Individual IPs can manage specific data needs
  pertinent to their projects.  Via its dashboard function, USAID and IP managers
  can see graphical analyses of how an IP, a project activity, or a more general program
  is doing for a particular time frame.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
